import React, { useState, useEffect } from 'react';
import { Language } from './languages';
import LanguageSelectorPopup from './LanguageSelectorPopup';

interface LandingPageProps {
  onNavigateToLogin: () => void;
  onNavigateToRegister: () => void;
  currentLanguage: Language;
  onLanguageChange: (language: Language) => void;
}

const LandingPage: React.FC<LandingPageProps> = ({
  onNavigateToLogin,
  onNavigateToRegister,
  currentLanguage,
  onLanguageChange
}) => {
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [showLanguagePopup, setShowLanguagePopup] = useState(false);

  // Check system dark mode preference
  useEffect(() => {
    const mediaQuery = window.matchMedia('(prefers-color-scheme: dark)');
    setIsDarkMode(mediaQuery.matches);

    const handleChange = (e: MediaQueryListEvent) => {
      setIsDarkMode(e.matches);
    };

    mediaQuery.addEventListener('change', handleChange);
    return () => mediaQuery.removeEventListener('change', handleChange);
  }, []);

  const t = (key: string) => {
    const translations: { [key: string]: { [key: string]: string } } = {
      en: {
        title: "Pediatric AI Assistant",
        subtitle: "Your trusted companion for child healthcare",
        description: "Get expert pediatric guidance, medication safety tips, and health advice for your little ones. Our AI pediatrician is here to help you make informed decisions about your child's health.",
        loginButton: "Sign In",
        registerButton: "Create Account",
        features: [
          "Expert pediatric guidance",
          "Medication safety analysis", 
          "Multi-language support",
          "24/7 health assistance"
        ]
      },
      hi: {
        title: "बाल चिकित्सा AI सहायक",
        subtitle: "आपके बच्चे की स्वास्थ्य देखभाल के लिए विश्वसनीय साथी",
        description: "अपने छोटे बच्चों के लिए विशेषज्ञ बाल चिकित्सा मार्गदर्शन, दवा सुरक्षा युक्तियां और स्वास्थ्य सलाह प्राप्त करें। हमारा AI बाल रोग विशेषज्ञ आपके बच्चे के स्वास्थ्य के बारे में सूचित निर्णय लेने में आपकी मदद करने के लिए यहां है।",
        loginButton: "साइन इन करें",
        registerButton: "खाता बनाएं",
        features: [
          "विशेषज्ञ बाल चिकित्सा मार्गदर्शन",
          "दवा सुरक्षा विश्लेषण",
          "बहु-भाषा समर्थन", 
          "24/7 स्वास्थ्य सहायता"
        ]
      }
    };

    return translations[currentLanguage.code]?.[key] || translations.en[key];
  };

  return (
    <div className={`landing-page ${isDarkMode ? 'dark' : 'light'}`}>
      {/* Language Selector Button */}
      <button 
        className="landing-language-btn"
        onClick={() => setShowLanguagePopup(true)}
      >
        <span className="language-btn-icon">🌍</span>
        {currentLanguage.nativeName}
      </button>

      {/* Hero Section */}
      <div className="landing-hero">
        <div className="hero-content">
          <div className="hero-icon">🩺</div>
          <h1 className="hero-title">{t('title')}</h1>
          <p className="hero-subtitle">{t('subtitle')}</p>
          <p className="hero-description">{t('description')}</p>

          {/* Feature List */}
          <div className="hero-features">
            {t('features').map((feature, index) => (
              <div key={index} className="feature-item">
                <span className="feature-icon">✨</span>
                <span>{feature}</span>
              </div>
            ))}
          </div>

          {/* Action Buttons */}
          <div className="hero-actions">
            <button 
              className="hero-btn primary"
              onClick={onNavigateToLogin}
            >
              {t('loginButton')}
            </button>
            <button 
              className="hero-btn secondary"
              onClick={onNavigateToRegister}
            >
              {t('registerButton')}
            </button>
          </div>
        </div>

        {/* Decorative Elements */}
        <div className="landing-decoration">
          <div className="floating-icon" style={{ top: '10%', left: '10%', animationDelay: '0s' }}>🩹</div>
          <div className="floating-icon" style={{ top: '20%', right: '15%', animationDelay: '1s' }}>💊</div>
          <div className="floating-icon" style={{ bottom: '30%', left: '20%', animationDelay: '2s' }}>🩺</div>
          <div className="floating-icon" style={{ bottom: '20%', right: '10%', animationDelay: '3s' }}>🏥</div>
        </div>
      </div>

      {/* Language Selector Popup */}
      <LanguageSelectorPopup
        isOpen={showLanguagePopup}
        onClose={() => setShowLanguagePopup(false)}
        onLanguageSelect={(language) => {
          onLanguageChange(language);
          setShowLanguagePopup(false);
        }}
        currentLanguage={currentLanguage}
      />
    </div>
  );
};

export default LandingPage;
